import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';

function Player ({nom,team,nationality,jerseyNumber,age,imagePath})
{
    return (

      

      <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={imagePath} />
      <Card.Body>
        <Card.Title>Nom : </Card.Title>
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item>Club : {team}</ListGroup.Item>
        <ListGroup.Item> Nationnality : {nationality}</ListGroup.Item>
        <ListGroup.Item>player Number : {jerseyNumber}</ListGroup.Item>
        <ListGroup.Item>age : {age}</ListGroup.Item>
      </ListGroup>
      
    </Card>

    
    );
}

export default Player;
